function Input (){
    
    var text = 0
    const onch = (event)=> {
        text = event.target.value
        console.log(text)
    }
    const d = (a,b)=>{ 
        return a+b;
    }
    useEffect(()=>{
        d(1,2)
    },[text])

    return(
        <div>
            <br></br>
            <from>
                <input  type="text"></input>
                <button onClick={onch}>ok</button>
            </from>

            <ul>
                <li>{text}</li>
            </ul>
        </div>
   
    )

}


export default Input;




